description:
Straight Up: Helicopters in Action

Technology Documentary hosted by Martin Sheen, published by IMAX in 2002 - English narration


Information
------------------------------

Straight Up! Helicopters In Action features more than a dozen helicopters in a series of pulse-pounding adventures that demonstrate the many roles these powerful aircraft play in our lives. Fly along with skilled helicopter crews as they carry out mountain and sea rescues, apprehend drug smugglers, repair high voltage electrical lines, save endangered animals, deliver humanitarian aid and undertake a reconnaissance mission.

